Polymorphism in Java allows for more flexible and reusable code by enabling methods with the same name but different parameters (method overloading) or return types (method overriding). This flexibility is achieved through the use of object-oriented programming principles, specifically inheritance and interfaces.

For example, consider a method that calculates the area of different shapes. Without polymorphism, we would need to create separate methods for each shape:

```java
public class Rectangle {
    public int calculateArea(int width, int height) {
        return width * height;
    }
}

public class Circle {
    public double calculateArea(double radius) {
        return Math.PI * radius * radius;
    }
}
```

With polymorphism, we can create a single method that takes an object of type Shape as a parameter:

```java
public abstract class Shape {
    public abstract double calculateArea();
}

public class Rectangle extends Shape {
    private int width;
    private int height;

    public Rectangle(int width, int height) {
        this.width = width;
        this.height = height;
    }

    @Override
    public double calculateArea() {
        return width * height;
    }
}

public class Circle extends Shape {
    private double radius;

    public Circle(double radius) {
        this.radius = radius;
    }

    @Override
    public double calculateArea() {
        return Math.PI * radius * radius;
    }
}
```

Now, we can create a method that takes an array of shapes as arguments and calculates the total area:

```java
public class Main {
    public static void main(String[] args) {
        Shape[] shapes = new Shape[]{new Rectangle(10, 20), new Circle(5)};
        double totalArea = calculateTotalArea(shapes);
        System.out.println(totalArea);
    }

    public static double calculateTotalArea(Shape[] shapes) {
        double totalArea = 0;
        for (Shape shape : shapes) {
            totalArea += shape.calculateArea();
        }
        return totalArea;
    }
}
```

In this example, the `calculateTotalArea` method can work with any type of shape that implements the `Shape` interface, making it more flexible and reusable.

