The concept you're referring to in Java is called synchronization or thread coordination. There are several ways to achieve this:

1.  Synchronized methods: You can use the `synchronized` keyword to ensure that only one thread can execute a method at a time.
2.  Locks: You can use the `Lock` interface from the `java.util.concurrent.locks` package to manually lock and unlock resources.
3.  Atomic variables: You can use atomic variables from the `java.util.concurrent.atomic` package to update shared variables in a thread-safe manner.
4.  ExecutorService: You can use an `ExecutorService` to manage threads and ensure that tasks are executed sequentially.

Here's an example of using synchronized methods:

```java
public class Counter {
    private int count = 0;

    public synchronized void increment() {
        count++;
    }

    public synchronized int getCount() {
        return count;
    }
}
```

And here's an example of using locks:

```java
import java.util.concurrent.locks.Lock;
import java.util.concurrent.locks.ReentrantLock;

public class Counter {
    private int count = 0;
    private final Lock lock = new ReentrantLock();

    public void increment() {
        lock.lock();
        try {
            count++;
        } finally {
            lock.unlock();
        }
    }

    public int getCount() {
        lock.lock();
        try {
            return count;
        } finally {
            lock.unlock();
        }
    }
}
```

In both examples, the `increment` and `getCount` methods are thread-safe because they're synchronized. However, using locks provides more flexibility and control over synchronization.

